DROP DATABASE IF EXISTS fall2020schedule;
CREATE DATABASE fall2020schedule;

USE fall2020schedule;

CREATE TABLE AllProfessors(
   First_Name     VARCHAR(17) NULL
  ,Last_Name      VARCHAR(18) NOT NULL
  ,Department     VARCHAR(34) NOT NULL
  ,Rating_Class   VARCHAR(7) NOT NULL
  ,Overall_Rating VARCHAR(3) NOT NULL
);

CREATE TABLE fall2020classes(
   Course_number             VARCHAR(11) NOT NULL
  ,Course_title              VARCHAR(90) NOT NULL
  ,Registration_restrictions VARCHAR(3) NOT NULL
  ,Units                     VARCHAR(22) NOT NULL
  ,Type                      VARCHAR(18) NOT NULL
  ,Section                   VARCHAR(6) NOT NULL
  ,Session                   INTEGER  NOT NULL
  ,Time                      VARCHAR(13) NOT NULL
  ,Days                      VARCHAR(9) NOT NULL
  ,Seats                     INTEGER  NOT NULL
  ,Registered                INTEGER  NOT NULL
  ,Waitlist                  INTEGER  NOT NULL
  ,Instructor                VARCHAR(251) NOT NULL
  ,Room                      VARCHAR(32) NOT NULL
);


